import Card from "./Card"

const Cards = ({courses}) => {
  let allCourses= [];
  const getCourses= ()=>{
    courses.values.forEach(courseCat => {
      courseCat.forEach((course)=>{
        allCourses.push(course);
      });
    });
  }
  getCourses();
  return (
    <div>      
      allCourses.map((course)=>{
        <Card/>
      });
    </div>
  )
}

export default Cards
